/** @format */

import React, { useState } from "react";
import "../../styles/find-car-form.css";
import { Table, Button } from "reactstrap";

const FindCarTable = () => {
  const [searchParams, setSearchParams] = useState({
    pickupAddress: "",
    dropoffAddress: "",
    rentalDate: "",
    rentalTime: "",
    carType: "",
  });

  const handleChange = (e) => {
    setSearchParams({
      ...searchParams,
      [e.target.name]: e.target.value,
    });
  };

  const handleSearch = () => {
    console.log("Search Params:", searchParams);
    // Perform the search based on searchParams
  };

  return (
    <div className="search-table-container">
      <Table bordered>
        <thead>
          <tr>
            <th>Địa chỉ nhận xe</th>
            <th>Địa chỉ trả xe</th>
            <th>Ngày thuê</th>
            <th>Giờ thuê</th>
            <th>Loại xe</th>
            <th>Tìm kiếm</th>
          </tr>
        </thead>
        <tbody>
          <tr>
            <td>
              <input
                type="text"
                name="pickupAddress"
                value={searchParams.pickupAddress}
                onChange={handleChange}
                placeholder="Nhập địa chỉ nhận xe"
              />
            </td>
            <td>
              <input
                type="text"
                name="dropoffAddress"
                value={searchParams.dropoffAddress}
                onChange={handleChange}
                placeholder="Nhập địa chỉ trả xe"
              />
            </td>
            <td>
              <input
                type="date"
                name="rentalDate"
                value={searchParams.rentalDate}
                onChange={handleChange}
              />
            </td>
            <td>
              <input
                type="time"
                name="rentalTime"
                value={searchParams.rentalTime}
                onChange={handleChange}
              />
            </td>
            <td>
              <select
                name="carType"
                value={searchParams.carType}
                onChange={handleChange}>
                <option value="">Chọn loại xe</option>
                <option value="sedan">Sedan</option>
                <option value="suv">SUV</option>
                <option value="mpv">MPV</option>
              </select>
            </td>
            <td>
              <Button color="primary" onClick={handleSearch}>
                Tìm xe
              </Button>
            </td>
          </tr>
        </tbody>
      </Table>
    </div>
  );
};

export default FindCarTable;
